// box lines
var box = [{a: [0, 0], b: [0, 1], n: [-1, 0]}, {a: [0, 1], b: [1, 1], n: [0, 1]}, {a: [1, 1], b: [1, 0], n: [1, 0]}, {a: [1, 0], b: [0, 0], n: [0, -1]}];

var createLine = function (p, x, y) {
  var p1 = {x: p.a[0] + x, y: p.a[1] + y},
    p2 = {x: p.b[0] + x, y: p.b[1] + y},
    n = {x: p.n[0], y: p.n[1]};

  var piece = function () {
    var piece = new THREE.Vector2();
    return piece.subVectors(p2, p1);
  }();

  var pLengthSq = function () {
    return piece.lengthSq();
  }();

  return {
    p1: p1,
    p2: p2,
    n: n,

    // find the nearest point to the given point on this line
    nearestPoint: function () {
      var tmp = new THREE.Vector2(),
        p = tmp.clone();
      return function (point) {
        var normalizedProjection = tmp.subVectors(p.copy(point), p1).dot(piece);
        if (normalizedProjection < 0) {
          return p1;
        } else if (normalizedProjection > pLengthSq) {
          return p2;
        } else {
          return tmp.copy(piece)
            .multiplyScalar(normalizedProjection / pLengthSq)
            .add(p1);
        }

      };
    }()

  };
};

module.exports = {
  getBoxLines: function (x, y) {
    var ret = [];
    _.each(box, function (l) {
      ret.push(createLine(l, x, y));
    });
    return ret;
  },
  getLines: function (n, x, y) {
    var ret = [];
    _.each(lines[n], function (l) {
      ret.push(createLine(l, x, y));
    });
    return ret;
  }
};
